import React from "react";

import Three_P_Left from "./ThreePLeft";
import Three_P_Right from "./Three_P_Right";

function Three_P_Lowerpart(){
    return(
        <>
        <div className="lower_part">
            <div >
                 <Three_P_Left></Three_P_Left>

                 <Three_P_Right></Three_P_Right>
            </div>
        </div>

        </>
    );
}

export default Three_P_Lowerpart;
